/* eslint-disable react/no-unescaped-entities */
import React, { Component } from "react"
import { Wrapper, Text, Title, InputBox, Button } from "./styles/forgotPassword"

class ForgotPassword extends Component {
  render() {
    return (
      <Wrapper>
        <Text>
          Please Enter the email address associated with your account and we will send
          you a link to reset your password
        </Text>
        <Title>Email</Title>
        <InputBox type="email" />
        <Button>Next</Button>
      </Wrapper>
    )
  }
}

export default ForgotPassword
